inp=""
deleted = False
l = list(inp)
while True:
	toRemove = []
	for i in range(len(l)-1):
		if l[i].lower() == l[i-1].lower() and i != 0 and l[i-1] != l[i]:
			
			if i not in toRemove and i-1 not in toRemove:
				toRemove.append(i)
				toRemove.append(i-1)
				deleted = True
	
	for i in sorted(toRemove, reverse=True):
		del l[i]

	if not deleted:
		break
	toRemove = []
	deleted = False

print(len(l))

